import React, { Component } from "react";
import { slide as Menu } from "react-burger-menu";
import {Link} from 'react-router-dom'

class MobileNav extends Component {

    render() {
        return ( 
        <div>
                <Menu noOverlay>
                    <hr />
                    <Link to="/"><a className="menu-item" href="/">Logo</a></Link>
                    <hr />
                    <Link to="/culture"><a className="menu-item" href="">People and Culture</a></Link>
                    <hr />
                   <Link to="/activities"><a className="menu-item" href="">Things to See and Do</a></Link>
                </Menu>
        </div>
        );
    }
}

export default MobileNav;
